package basicPart1;

public class SwapTwo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a, b, t;
		a=50;
		b=100;
		
		System.out.println("\nBefore Swapping :"+ a + " "+ b);
		
		t=a;
		a=b;
		b=t;
		
		System.out.println("\nAfter Swapping :"+ a + " "+ b);
	}

}
